import { makeStyles } from "@material-ui/core/styles";

export default makeStyles((theme) => ({
	top_container: {
		display: "grid",
		gridTemplateColumns: "auto auto",
		marginLeft: 30,
	},
	buttons: {
		display: "flex",
		justifyContent: "flex-end",
	},
}));
